import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div>
      <h1>ユーザー名</h1>
      <p>口座番号</p>
      <button onClick={() => navigate('/recipients')}>送金先</button>
    </div>
  );
}

export default Home;
